illy</a> meetup, dive into the\n          <a href="https://github.com/timwis/philly-ward-leaders" target="_blank">source code</a>, or join the conversation around\n          <a href="https://github.com/timwis/philly-ward-leaders/issues" target="_blank">pending issues</a>.\n\n          <h2>The Team</h2>\n          <ul>\n            <li><a href="http://davewalk.net" target="_blank">Dave Walk</a></li>\n            <li><a href="http://laurenancona.com" target="_blank">Lauren Ancona</a></li>\n            <li><a href="https://twitter.com/technologyriff" target="_blank">Morgan Riffer</a></li>\n            <li><a href="https://twitter.com/skeegenin" target="_blank">Nicholas Stanley</a></li>\n            <li><a href="https://twitter.com/sophiannagirl" target="_blank">Sophia Shapira</a></li>\n            <li><a href="http://timwis.com" target="_blank">Tim Wisniewski</a></li>\n            <li><a href="http://zacharyrendin.com/" target="_blank">Zach Rendin</a></li>\n          </ul>\n          <p>Philly Ward Leaders is now maintained by <a href="http://seventy.org">Committee of Seventy</a></p>\n\n          <h2>Sources</h2>\n          We used several official data sources and a lot of research on google for the rest. The combined data was put into a\n          <a href="https://docs.google.com/spreadsheets/d/1nkkFQUaxcGa0oDPWl1Vr1cknToIq8FxfJ7CILQrFgBM/edit?usp=sharing" target="_blank">spreadsheet</a>\n          that powers this site.\n          <ul>\n            <li><a href="https://www.seventy.org/tools/ward-leaders-committeepeople/democratic-party" target="_blank">Ward Leader List</a>, Committee of Seventy</li>\n            <li><a href="https://www.opendataphilly.org/dataset/voter-turnout" target="_blank">Voter Turnout</a>, City of Philadelphia</li>\n            <li><a href="https://www.opendataphilly.org/dataset/elected-committeepeople" target="_blank">Elected Committee People</a>, City of Philadelphia</li>\n            <li><a href="https://www.opendataphilly.org/dataset/police-divisions" target="_blank">Division Boundaries</a>, City of Philadelphia</li>\n            <li><a href="https://www.opendataphilly.org/dataset/qualified-voter-registry" target="_blank">Qualified Voter Registry</a>, City of Philadelphia</li>\n            <li>And lots of googling!</li>\n          </ul>\n     </div>\n</div>\n<footer><img src="img/Code-for-Liberty_grey200.png"> A <a href="http://codeforphilly.org" target="_blank">Code for Philly</a> project</footer>\n';
